import { useState } from 'react';
import data from './moviedatasample.json';

const MDS = data.MovieData;

function MovieList() {
  const [ListofMovies, setListofMovies] = useState(MDS);
  const addMovie = () => {
    setListofMovies(
      [
        ...MDS,

      ]
    )
  };
  return (
    <>
      <div>
        <h3>Joel Hilton's Movie</h3>
      </div>

      <div>
        <table className="table">
          <thead>
            <tr>
              <th>Title</th>
              <th>Year</th>
              <th>Director</th>
              <th>Rating</th>
              <th>Category</th>
            </tr>
          </thead>
          <tbody>
            {MDS.map((m) => (
              <tr>
                <td>{m.Title}</td>
                <td>{m.Year}</td>
                <td>{m.Director}</td>
                <td>{m.Rating}</td>
                <td>{m.Category}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <button className='btn btn-primary' onClick="addMovie">Add Movie</button>
    </>
  );
}

export default MovieList;
